import React, { Component } from 'react'

export default class TimeLine extends Component {

    constructor() {
        super()
        this.state = {
            timeLine: []
        }
    }

    componentDidMount() {
        fetch('/timeline')
            .then(res => res.json())
            .then(res => {
                console.log(res)
                this.setState({
                    timeLine: res
                })
            })
    }

    render() {
        const merchantCard = this.state.timeLine.map((eachCard, index) => {
            return <>
                <div>{eachCard.name}</div>
            </>
        })
        return (
            <div>

            </div>
        )
    }
}
